import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.scss";

const NavBar = () => {
  return (
    <div className="nav-bar">
      <NavLink to="/homeview" className="meme-book">Meme < br/> Book</NavLink>
      {/* <NavLink to="/homeview/feed">Feed</NavLink> */}
      <NavLink to="/homeview/create" className="create-meme">Create</NavLink>
      <a href="/" >Logout</a>
    </div>
  );
};

export default NavBar;
